          src="https://i.vietgiaitri.com/2021/8/1/chan-dung-hot-girl-le-phuong-anh---gai-xinh-vuong-nghi-van-lo-clip-chong-day-588-5928249.jpg"
          alt=""
        />
      </div>
    </div>
  );
}

export default Message;
